<template>
  <div class="capture-wrapper">
    <div class="title-header">信息列表</div>
    <div class="snap-wrap">
      <div class="pic-div-one" v-for="(item,index) in catureInfos" :key="index">
        <div class="pic-detail">
          <div class="camera-title"><i class="fa fa-map-marker"></i>{{item.cameraName}}</div>
          <div class="img-wrap"><img :src="item.imgUrl" class="demo-img" /></div>
          <div class="time-div">抓拍时间:{{item.time}}
            <i class="fa fa-trash" title="删除" @click="deleteCatureInfo(index)"></i>
            <!--<i class="fa fa-plus-circle" title="添加任务" @click="openAddTaskDialog(index,item.cameraCode)"></i>-->
          </div>
        </div>
      </div>
      <div class="pic-div-one" v-if="catureInfos.length === 0">
        <div class="no-pic-div">暂无图片<br>(请点击抓拍采集照片)</div>
      </div>
    </div>
  </div>
</template>
<script>
  import passParam from '../../utils/ext.passParam'
  export default {
      data(){
          return{
            dialogVisible:false,
            unChange:false,
            catureInfos:[],
            /*catureInfos:[
              {
                cameraName: "会见室1",
                //imgUrl: "https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1576819056809&di=c53f742045df8b007985efe818eba63d&imgtype=0&src=http%3A%2F%2Fb"+".hiphotos.baidu.com%2Fimage%2Fpic%2Fitem%2F908fa0ec08fa513db777cf78376d55fbb3fbd9b3.jpg",
                imgUrl: "data:image/jpg;base64,",
                time: "2019-12-19 11:03:12"
              }
            ]*/
          }
      },
      mounted() {
        // 用$on事件来接收参数
        passParam.$on('captureData', (data) => {
          console.log(data,"data");
          this.catureInfos = data;
        });
      },
      methods:{
          //删除抓拍的信息
        deleteCatureInfo(index){
            this.catureInfos.splice(index,1);
        },
        //打开任务添加的窗口
        openAddTaskDialog(index,cameraCode){
          this.dialogVisible = true;
          const imgUrl = this.catureInfos[index].imgUrl;
          this.$nextTick(()=>{
            this.$refs.addTask.imgUrl = imgUrl;
            this.$refs.addTask.cameraCode = cameraCode;
//            this.$refs.addTask.cameraCode = cameraCode?cameraCode:"37060191001310000002";
            this.$refs.addTask.initCanvas();  //初始化画布信息
          })
        },
//        关闭dialog
        closeODialog(flag){
          this.dialogVisible = flag;
        },
        //打开dialog的回调函数
        openDialog(){
          this.$nextTick(()=>{
            this.$refs.addTask.rule = [];
            this.$refs.addTask.initFormItem();
            this.$refs.addTask.clearCanvas();
            this.$refs.addTask.savePicture();
          })
        },
        //关闭dialog的回调函数
        closeDialog(){
          this.$refs.addTask.resetForm('form')
        },
      }
  }
</script>
<style lang="less">
  @import "./styles/drawer-video-capture.less";
</style>
